import { t } from 'i18next';
import React from 'react';
import Layout from './Components/layout';

const Contacts = () => {
  return (
    <Layout>
      <div className="contacts">
        <div className= "big-title-Book" > {t("contacts-contacts-title")}</div>
      </div>
    </Layout>
  );
};

export default Contacts;
